const initialState = {
  yandexDrive:'',
    delimobil:'22',
    belkaCar:'',
    youDrive:'',
    rentmee:'',
    bibi:'8888'
}

export default function adminReducer(state = initialState, action ) {
  switch (action.type){
    default:
      return state
  }
}
